INSERT INTO [dbo].[CLO] ([MaCLO], [MaMonHoc], [MaSoCLO], [TenCLO], [MoTa], [ThuTu], [TrangThai], [NgayTao], [NgaySua]) VALUES
  ('e266cae7-549f-4eb8-9782-1f5a6d9b4786', '364237c5-b271-4161-8e53-78a7a4ec501c', N'CLO1', N'Chuẩn đầu ra CLO1 cho Môn học Deliver Best-Of-Breed Synergies', N'Gần đang vài thì. Tại từng có rất đúng. Lớn sau của từ tại được chưa nhưng. Có mà như chưa.', 1, 1, '2025-06-04 07:22:45', NULL),
  ('07034a13-7c9b-4aaa-910e-44e4f5871e71', '364237c5-b271-4161-8e53-78a7a4ec501c', N'CLO2', N'Chuẩn đầu ra CLO2 cho Môn học Deliver Best-Of-Breed Synergies', N'Nếu chưa một cũng vẫn không hoặc. Theo với tại đó khi nhưng. Như để từ nào từ để số với.', 2, 1, '2025-05-23 15:17:16', NULL),
  ('e3ddfe09-9217-4d71-b593-6cbbc2ab4744', '364237c5-b271-4161-8e53-78a7a4ec501c', N'CLO3', N'Chuẩn đầu ra CLO3 cho Môn học Deliver Best-Of-Breed Synergies', N'Hơn để sau. Được trong dưới là hoặc từng. Đó nhưng bạn với đang của để.', 3, 1, '2025-05-10 07:27:42', NULL),
  ('91ea751e-a1cb-47d0-8588-cacfd1316d45', '364237c5-b271-4161-8e53-78a7a4ec501c', N'CLO4', N'Chuẩn đầu ra CLO4 cho Môn học Deliver Best-Of-Breed Synergies', N'Làm cũng bạn đang bên hơn. Bên khiến giống nào. Tự sẽ cách chỉ nhưng.', 4, 1, '2025-05-15 03:19:27', NULL),
  ('3d86b71f-dfb6-40aa-acd3-3f713bb11af9', '364237c5-b271-4161-8e53-78a7a4ec501c', N'CLO5', N'Chuẩn đầu ra CLO5 cho Môn học Deliver Best-Of-Breed Synergies', N'Với không với. Vẫn bên thay như đang trong. Cách đó rất có số.', 5, 1, '2025-05-27 22:30:49', NULL),
  ('a28b990a-0eb0-45f4-9fe8-97683b688dd4', '14d1ec21-caeb-4950-ab42-862ca10199f5', N'CLO1', N'Chuẩn đầu ra CLO1 cho Môn học Repurpose Holistic Partnerships', N'Điều với nhưng. Với sẽ cũng của.', 1, 1, '2025-05-07 23:57:25', NULL),
  ('ba21f259-352f-43e8-bb68-17cd3777e744', '14d1ec21-caeb-4950-ab42-862ca10199f5', N'CLO2', N'Chuẩn đầu ra CLO2 cho Môn học Repurpose Holistic Partnerships', N'Cũng lớn bên. Của rất từng tự. Mà là một từ các của.', 2, 1, '2025-05-18 05:07:19', NULL),
  ('652f98bb-4a8e-4140-a449-1f842a0d5ccb', '14d1ec21-caeb-4950-ab42-862ca10199f5', N'CLO3', N'Chuẩn đầu ra CLO3 cho Môn học Repurpose Holistic Partnerships', N'Số sẽ thì tự sẽ một. Thay vài thay khi bên tự thế. Có khiến không thế và nào bạn đang.', 3, 1, '2025-05-28 17:36:14', NULL),
