INSERT INTO [dbo].[YeuCauRutTrich] ([MaYeuCauDe], [HoTenGiaoVien], [NoiDungRutTrich], [NgayLay]) VALUES
  ('ed73f589-6174-47c0-8711-a8613d7e5912', N'Nhiên Đặng', N'Mỗi vì sau từ dưới cũng vì. Vẫn của mỗi người từ nhưng. Theo trong để các.', '2025-05-07 18:35:11'),
  ('2859409d-2506-4531-8d0e-d1adc0331915', N'Cô Ánh Vũ', N'Cũng hơn trong đã sau của. Đã mỗi chỉ. Điều mỗi từ chưa dưới như. Chưa để khi được cho. Điều mỗi như mỗi. Tại như điều các.', '2025-05-22 19:11:19'),
  ('165d3715-5754-4195-8fe1-752195f6b888', N'Cô Ánh Vũ', N'Này gần đúng đã. Đúng được đúng lớn. Điều có giữa đi sau của vì.', '2025-05-17 01:40:08'),
  ('3055bc7f-fa5d-43b9-990d-f9f582f330d0', N'Cô Kim Nguyễn', N'Sẽ vài về dưới nhiều để để. Đến này làm người nếu giữa. Làm là là nếu để cái. Như thì nơi. Của để đã theo một thay mỗi. Vậy giống của cách từ.', '2025-06-02 07:14:22'),
  ('88dbfa25-dcab-4748-b82c-42ed029a3dc1', N'Vũ Trần', N'Tôi giống với có chỉ của. Để này lớn người cũng. Về sẽ của vẫn các. Vẫn gần có từng thay vì như từ.', '2025-05-27 08:23:10'),
  ('e1338a70-725b-41a7-81d2-739b2d8a9dec', N'Nhật Hữu Phạm', N'Hơn thế cũng như như trong nếu. Cái như sau tự vậy. Của như khiến với cách và tôi. Trong khiến để tại sẽ.', '2025-06-04 01:02:12'),
  ('9f32498f-262f-4b48-98bb-f3de316052d9', N'Thành Tấn Phạm', N'Như giữa bạn. Giống của hoặc các mỗi vài tại. Vì chỉ khiến trong cách giống từng. Để thế thế gần từ khi bạn. Đó đang vẫn đang cách cũng. Cũng cũng theo.', '2025-05-21 05:18:02'),
  ('02f3b0d6-bc27-4ac6-a123-b5a412ae5278', N'Anh Quang Đặng', N'Với mà tôi đi vẫn sau khiến. Chỉ nào hoặc người hoặc. Cũng vẫn khi của giữa đang với có. Vài nếu nào về. Từng điều này cũng cho.', '2025-05-10 09:01:21'),
  ('3113e7f9-e825-47d0-8379-34c18c875970', N'Bác Hưng Phạm', N'Giống nếu vì của. Với như từng và hơn nhưng các. Tự như và trong số như. Để các với.', '2025-05-13 12:53:44'),
  ('b153c96f-be5c-443a-b740-c8f1dcb4c812', N'Nhiên Dương', N'Từng từng nếu làm. Từng nào dưới tự và. Hơn nếu với và chưa. Khi mà là đi của. Và về số rất cách khi cái.', '2025-05-24 13:47:34');
